package sms002;

public class switchof {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String String = "t";
		
		switch(String)
		{
		case "y":
			System.out.println("111");
			break;
		case "t":
			System.out.println("222");
			break;
		default:
			System.out.println("222");
		}

	}

}

